import React, { useState } from 'react';
import './style.css';
import Navbar from './components/Navbar';
import PrincipalSection from './components/PrincipalSection';
import DescriptionSection from './components/DescriptionSection';
import FeaturesSection from './components/FeaturesSection';
import ServicesSection from './components/ServicesSection';
import AmbientsSection from './components/AmbientsSection';
import InstallationsSection from './components/InstallationsSection';
import MultimediaSection from './components/MultimediaSection';
import ComparisonSection from './components/ComparisonSection';
import StatisticsSection from './components/StatisticsSection';
import Footer from './components/Footer';

function App() {
  const [activeSection, setActiveSection] = useState('principal');

  const handleNavClick = (sectionId) => {
    setActiveSection(sectionId);
  };

  return (
    <div>
      <Navbar onNavClick={handleNavClick} />
      {activeSection === 'principal' && <PrincipalSection />}
      {activeSection === 'description' && <DescriptionSection />}
      {activeSection === 'features' && <FeaturesSection />}
      {activeSection === 'services' && <ServicesSection />}
      {activeSection === 'ambients' && <AmbientsSection />}
      {activeSection === 'installations' && <InstallationsSection />}
      {activeSection === 'multimedia' && <MultimediaSection />}
      {activeSection === 'comparison' && <ComparisonSection />}
      {activeSection === 'statistics' && <StatisticsSection />}
      <Footer />
    </div>
  );
}

export default App;
